import React, { useEffect, useState } from 'react'

 const Todolist = ({data}) => {
       let filteredtodo = data
    .slice(0,10)
    .map((todo)=>{
        return(
            <div key={todo.userId}>
                <p>
                    <strong>{todo.title}</strong>
                </p>
            </div>
        )
    })
  return (

    <div>
                    {filteredtodo}
    </div>
  )
  }
  const SearchTodo=HOC()
export default Todolist
